import React from "react";
import Slider from "../components/Slider";
import HomeComponent from "../components/HomeComponent";

function Home() {
  return (
    <div>
    <Slider />
    <HomeComponent />
    <h1>Home Page</h1>
    </div>
  );
}

export default Home;
